// import { useState } from 'react';
import ScrollToTop from './scrolltotop/scrollToTop';
import { Helmet } from 'react-helmet';
import Steps from './steps/Steps';
import styled from 'styled-components';

const DIV = styled.div`
    .black-look{
        text-align: left;
        color: white;
        max-width: 1100px;
        background-color: black;
        border-radius: 50px;
        margin-top: 3px;
        margin-bottom: 50px;
        padding: 50px;
        font-size: 40px;
    }
    .black-look p{
        color: white;
        margin-bottom: 40px;
    }
    #say{
        font-size: 18px;
    }
    #sign-up{
        background: white;;
        margin-top: 20px;
        border: 1px solid #f1356d;
        padding: 8px 15px;
        border-radius: 40px;
        cursor: pointer;
        font-size: 20px;
        transition: all 0.1s linear;
    }
    #log-in{
        background: white;;
        margin-top: 20px;
        border: 1px solid #f1356d;
        padding: 8px 15px;
        border-radius: 40px;
        cursor: pointer;
        font-size: 20px;
        transition: all 0.1s linear;
    }
`
const Home = () => {
    return ( 
        <DIV className = "home">
            <Helmet>
                <title>Home | Fresherstrip</title>
            </Helmet>
            <div className = "black-look">
                    <p>Welcome to Fresherstrip,</p>
                    <p id = "say">We offer Babcock University 100 level School of Computing and Engineering Sciences and Mass Comm the steps and location to make your signing process faster.<br/><br/>
                    Down here are the eight(8) steps you need to take, click on them to get the directions.</p>                
            </div>
             
            <button id = "sign-up">Sign Up</button>
            <button id = "log-in">Log In</button>
            {/* <Steps></Steps> */}
            <ScrollToTop></ScrollToTop>
        </DIV>
    );
}
 
export default Home;
